Instruction to Activate:
1. CLICK HELP
2. Click &quot;Enter Registration Info.&quot;
3. Copy the &quot;Customer Name&quot; from your receipt into the first box at the top of the dialog screen.
4. Copy the &quot;Registration Key&quot; on your receipt into the second box.
5. Click &quot;OK.&quot; You have now entered and registered your serial for Winamp.



